import React from 'react';
import { ThemeProvider } from './theme/ThemeContext';
import './App.css';

function App() {
  return (
    <ThemeProvider>
      <div className="App">
        <header className="App-header">
          <h1>Microsoft Defender</h1>
          <p>Welcome to the Microsoft Defender prototype</p>
        </header>
      </div>
    </ThemeProvider>
  );
}

export default App;
